%81%D1%82%D0%BE%D0%B2%D1%8B%D0%B5_%D0%BF%D0%BE%D1%85%D0%BE%D0%B4%D1%8B\" title=\"\u041a\u0440\u0435\u0441\u0442\u043e\u0432\u044b\u0435 \u043f\u043e\u0445\u043e\u0434\u044b\">\u043a\u0440\u0435\u0441\u0442\u043e\u043d\u043e\u0441\u0446\u0430\u043c\u0438<\/a> \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u043a\u043e\u0435 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e\">\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u043a\u043e\u0435 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e<\/a>. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC\" title=\"\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\">\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0435<\/a>, \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D1%80%D0%B0%D0%BC_%D0%93%D1%80%D0%BE%D0%B1%D0%B0_%D0%93%D0%BE%D1%81%D0%BF%D0%BE%D0%B4%D0%BD%D1%8F\" title=\"\u0425\u0440\u0430\u043c \u0413\u0440\u043e\u0431\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044f\">\u0445\u0440\u0430\u043c\u0435 \u0413\u0440\u043e\u0431\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044f<\/a>, \u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_II_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8)\" title=\"\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0439 \u0420\u0438\u043c\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438)\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II<\/a> (1194\u20141250) \u0432\u0435\u043d\u0447\u0430\u043b \u0441\u0435\u0431\u044f \u043a\u043e\u0440\u043e\u043d\u043e\u0439 \u0432\u043e\u0437\u0440\u043e\u0436\u0434\u0435\u043d\u043d\u043e\u0433\u043e \u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u043a\u043e\u0435 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e\">\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u0430<\/a>, \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043d\u043e\u0433\u043e \u0432 \u0445\u043e\u0434\u0435 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043a\u0440\u0435\u0441\u0442\u043e\u0432\u043e\u0433\u043e \u043f\u043e\u0445\u043e\u0434\u0430 1099 \u0433\u043e\u0434\u0430 \u0438 \u0443\u043f\u0440\u0430\u0437\u0434\u043d\u0451\u043d\u043d\u043e\u0433\u043e \u0432 1187-\u043c \u0441\u0443\u043b\u0442\u0430\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BB%D0%B0%D1%85_%D0%B0%D0%B4-%D0%94%D0%B8%D0%BD\" title=\"\u0421\u0430\u043b\u0430\u0445 \u0430\u0434-\u0414\u0438\u043d\">\u0421\u0430\u043b\u0430\u0445-\u0430\u0434-\u0434\u0438\u043d\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1241_%D0%B3%D0%BE%D0%B4\" title=\"1241 \u0433\u043e\u0434\">1241<\/a>&#160;\u2014 \u0432 \u0431\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u0425\u043c\u0435\u043b\u044c\u043d\u0438\u043a\u043e\u043c (\u0432\u0431\u043b\u0438\u0437\u0438 \u041a\u0440\u0430\u043a\u043e\u0432\u0430) \u0432\u043e\u0439\u0441\u043a\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%B0%D1%8F_%D0%9E%D1%80%D0%B4%D0%B0\" title=\"\u0417\u043e\u043b\u043e\u0442\u0430\u044f \u041e\u0440\u0434\u0430\">\u0417\u043e\u043b\u043e\u0442\u043e\u0439 \u041e\u0440\u0434\u044b<\/a> \u043f\u043e\u0431\u0435\u0436\u0434\u0430\u0435\u0442 \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u0432\u043e\u0439\u0441\u043a\u043e \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D0%BE-%D1%82%D0%B0%D1%82%D0%B0%D1%80%D1%8B\" class=\"mw-redirect\" title=\"\u041c\u043e\u043d\u0433\u043e\u043b\u043e-\u0442\u0430\u0442\u0430\u0440\u044b\">\u043c\u043e\u043d\u0433\u043e\u043b\u043e-\u0442\u0430\u0442\u0430\u0440\u044b<\/a> \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044e\u0442 \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u043d\u0438\u0435 \u0415\u0432\u0440\u043e\u043f\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1314_%D0%B3%D0%BE%D0%B4\" title=\"1314 \u0433\u043e\u0434\">1314<\/a>&#160;\u2014 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0430\u043f\u0441\u0442\u0432\u043e\">\u043f\u0430\u043f\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B4\" title=\"\u0421\u0443\u0434\">\u0441\u0443\u0434<\/a> \u043d\u0430\u0434 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u043c\u0430\u0433\u0438\u0441\u0442\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B0%D0%BA_%D0%B4%D0%B5_%D0%9C%D0%BE%D0%BB%D0%B5\" class=\"mw-redirect\" title=\"\u0416\u0430\u043a \u0434\u0435 \u041c\u043e\u043b\u0435\">\u0416\u0430\u043a\u043e\u043c \u041c\u043e\u043b\u0435<\/a> \u0438 \u0434\u0440\u0443\u0433\u0438\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BC%D0%BF%D0%BB%D0%B8%D0%B5%D1%80%D1%8B\" title=\"\u0422\u0430\u043c\u043f\u043b\u0438\u0435\u0440\u044b\">\u0442\u0430\u043c\u043f\u043b\u0438\u0435\u0440\u0430\u043c\u0438<\/a>, \u0434\u043e\u0436\u0438\u0434\u0430\u0432\u0448\u0438\u043c\u0438\u0441\u044f \u044d\u0442\u043e\u0433\u043e \u0441\u0443\u0434\u0430 7 \u043b\u0435\u0442. \u0418\u0445 \u043e\u0441\u0443\u0436\u0434\u0430\u044e\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B6%D0%B8%D0%B7%D0%BD%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BB%D0%B8%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_%D1%81%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D1%8B\" title=\"\u041f\u043e\u0436\u0438\u0437\u043d\u0435\u043d\u043d\u043e\u0435 \u043b\u0438\u0448\u0435\u043d\u0438\u0435 \u0441\u0432\u043e\u0431\u043e\u0434\u044b\">\u043f\u043e\u0436\u0438\u0437\u043d\u0435\u043d\u043d\u043e\u0435 \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435<\/a>. \u0410 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043c\u0430\u0433\u0438\u0441\u0442\u0440\u0430 \u0434\u0435 \u041c\u043e\u043b\u0435 \u0438 \u043f\u0440\u0438\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%80%D0%BC%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u043e\u0440\u043c\u0430\u043d\u0434\u0438\u044f\">\u041d\u043e\u0440\u043c\u0430\u043d\u0434\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B6%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0421\u043e\u0436\u0436\u0435\u043d\u0438\u0435\">\u0441\u0436\u0438\u0433\u0430\u044e\u0442 \u043d\u0430 \u043a\u043e\u0441\u0442\u0440\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1325_%D0%B3%D0%BE%D0%B4\" title=\"1325 \u0433\u043e\u0434\">1325<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BD%D0%BE%D1%87%D1%82%D0%B8%D1%82%D0%BB%D0%B0%D0%BD\" title=\"\u0422\u0435\u043d\u043e\u0447\u0442\u0438\u0442\u043b\u0430\u043d\">\u0422\u0435\u043d\u043e\u0447\u0442\u0438\u0442\u043b\u0430\u043d<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0441\u0442\u0430\u043b \u0441\u0442\u043e\u043b\u0438\u0446\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%86%D1%82%D0%B5%D0%BA%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0446\u0442\u0435\u043a\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0430\u0446\u0442\u0435\u043a\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1617_%D0%B3%D0%BE%D0%B4\" title=\"1617 \u0433\u043e\u0434\">1617<\/a>&#160;\u2014 \u0432\u0435\u043b\u0438\u043a\u0438\u0435 \u043f\u043e\u0441\u043b\u044b \u043f\u0440\u0438\u0441\u043b\u0430\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B3%D0%BE%D1%80%D0%BE%D0%B4_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434 \u0412\u0435\u043b\u0438\u043a\u0438\u0439\">\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434 \u0412\u0435\u043b\u0438\u043a\u0438\u0439<\/a> \u0426\u0430\u0440\u0441\u043a\u0443\u044e \u0433\u0440\u0430\u043c\u043e\u0442\u0443 \u0441 \u0438\u0437\u0432\u0435\u0449\u0435\u043d\u0438\u0435\u043c \u043e \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0438 \u0441\u043e \u0448\u0432\u0435\u0434\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A1%D1%82%D0%BE%D0%BB%D0%BE%D0%B1%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0421\u0442\u043e\u043b\u043e\u0431\u043e\u0432\u0441\u043a\u0438\u0439 \u043c\u0438\u0440 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0421\u0442\u043e\u043b\u0431\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043c\u0438\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1625_%D0%B3%D0%BE%D0%B4\" title=\"1625 \u0433\u043e\u0434\">1625<\/a>&#160;\u2014 \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B5%D0%BF%D0%B0%D1%8F\" title=\"\u041b\u0438\u0435\u043f\u0430\u044f\">\u041b\u0438\u0431\u0430\u0432\u0430 (\u043d\u044b\u043d\u0435 \u041b\u0438\u0435\u043f\u0430\u044f)<\/a> \u043f\u043e\u043b\u0443\u0447\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B3%D0%B4%D0%B5%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE\" title=\"\u041c\u0430\u0433\u0434\u0435\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u043e\">\u043c\u0430\u0433\u0434\u0435\u0431\u0443\u0440\u0433\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1662_%D0%B3%D0%BE%D0%B4\" title=\"1662 \u0433\u043e\u0434\">1662<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u043f\u043e\u044f\u0432\u0438\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82\" title=\"\u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\">\u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442<\/a>&#160;\u2014 \u0432\u043e\u0441\u044c\u043c\u0438\u043c\u0435\u0441\u0442\u043d\u0430\u044f \u043a\u0430\u0440\u0435\u0442\u0430, \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u0430\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BC%D0%BD%D0%B8%D0%B1%D1%83%D1%81\" title=\"\u041e\u043c\u043d\u0438\u0431\u0443\u0441\">\u043e\u043c\u043d\u0438\u0431\u0443\u0441<\/a>\u00bb, \u0447\u0442\u043e \u043e\u0437\u043d\u0430\u0447\u0430\u043b\u043e&#160;\u2014 \u00ab\u0434\u043b\u044f \u0432\u0441\u0435\u0445\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1797_%D0%B3%D0%BE%D0%B4\" title=\"1797 \u0433\u043e\u0434\">1797<\/a>&#160;\u2014 \u0438\u0437\u0434\u0430\u043d \u0432\u044b\u0441\u043e\u0447\u0430\u0439\u0448\u0438\u0439 \u0423\u043a\u0430\u0437 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u044f \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_I\" title=\"\u041f\u0430\u0432\u0435\u043b I\">\u041f\u0430\u0432\u043b\u0430 I<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9E_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0%D1%82%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D0%B8_%D0%B2%D1%8B%D1%88%D0%B5%D0%B4%D1%88%D0%B8%D1%85_%D1%80%D0%B0%D0%BD%D0%B5%D0%B5_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD%D0%BE%D0%B2&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041e \u0441\u0438\u0441\u0442\u0435\u043c\u0430\u0442\u0438\u0437\u0430\u0446\u0438\u0438 \u0432\u044b\u0448\u0435\u0434\u0448\u0438\u0445 \u0440\u0430\u043d\u0435\u0435 \u0437\u0430\u043a\u043e\u043d\u043e\u0432 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041e \u0441\u0438\u0441\u0442\u0435\u043c\u0430\u0442\u0438\u0437\u0430\u0446\u0438\u0438 \u0432\u044b\u0448\u0435\u0434\u0448\u0438\u0445 \u0440\u0430\u043d\u0435\u0435 \u0437\u0430\u043a\u043e\u043d\u043e\u0432<\/a>\u00bb, \u043f\u0440\u0438\u0437\u0432\u0430\u043d\u043d\u044b\u0439 \u043f\u043e\u043b\u043e\u0436\u0438\u0442\u044c \u043a\u043e\u043d\u0435\u0446 \u043d\u0435\u043f\u0440\u0430\u0432\u043e\u0441\u0443\u0434\u0438\u044e \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B7%D1%8F%D1%82%D0%BE%D1%87%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" class=\"mw-redirect\" title=\"\u0412\u0437\u044f\u0442\u043e\u0447\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e\">\u0432\u0437\u044f\u0442\u043e\u0447\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0443<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u0441\u0435\u0431\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u041a\u043e\u0440\u043e\u043b\u044c \u0418\u0442\u0430\u043b\u0438\u0438\">\u043a\u043e\u0440\u043e\u043b\u0451\u043c \u0418\u0442\u0430\u043b\u0438\u0438<\/a>. \u041d\u0430\u0447\u0430\u043b\u043e \u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f \u0430\u043d\u0442\u0438\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u0438 \u0438\u0437 \u0420\u043e\u0441\u0441\u0438\u0438, \u0410\u0432\u0441\u0442\u0440\u0438\u0438 \u0438 \u0410\u043d\u0433\u043b\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B4%D0%B8%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F\" title=\"\u041a\u0430\u0434\u0438\u0441\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f\">\u041a\u0430\u0434\u0438\u0441\u0441\u043a\u043e\u0439 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438<\/a>, \u043f\u0435\u0440\u0432\u043e\u0439 \u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1813_%D0%B3%D0%BE%D0%B4\" title=\"1813 \u0433\u043e\u0434\">1813<\/a>&#160;\u20