9_%D0%B3%D0%BE%D0%B4\" title=\"1839 \u0433\u043e\u0434\">1839<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440<\/a> \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u0435\u0442 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u043c \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u043c \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f\u043c \u0432\u0432\u043e\u0437\u0438\u0442\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B8%D1%83%D0%BC\" title=\"\u041e\u043f\u0438\u0443\u043c\">\u043e\u043f\u0438\u0443\u043c<\/a>, \u0447\u0442\u043e \u0441\u0442\u0430\u043b\u043e \u043f\u0440\u0438\u0447\u0438\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B8%D1%83%D0%BC%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043e\u043f\u0438\u0443\u043c\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u043f\u0435\u0440\u0432\u043e\u0439 \u043e\u043f\u0438\u0443\u043c\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1848_%D0%B3%D0%BE%D0%B4\" title=\"1848 \u0433\u043e\u0434\">1848<\/a>&#160;\u2014 \u0412\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u0438\u0439 \u0441\u0435\u0439\u043c \u043f\u0440\u0438\u043d\u044f\u043b \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u043b\u0438\u043a\u0432\u0438\u0434\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D0%BF%D0%BE%D1%81%D1%82%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE\" title=\"\u041a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e\">\u043a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BA%D0%B0%D1%80%D0%BF%D0%B0%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u0417\u0430\u043a\u0430\u0440\u043f\u0430\u0442\u0441\u043a\u0430\u044f \u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0417\u0430\u043a\u0430\u0440\u043f\u0430\u0442\u0441\u043a\u043e\u0439 \u0423\u043a\u0440\u0430\u0438\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1850_%D0%B3%D0%BE%D0%B4\" title=\"1850 \u0433\u043e\u0434\">1850<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0431\u0438\u0437\u043d\u0435\u0441\u043c\u0435\u043d\u044b \u0425\u0435\u043d\u0440\u0438 \u0423\u044d\u043b\u043b\u0441 \u0438 \u0423\u0438\u043b\u044c\u044f\u043c \u0424\u0430\u0440\u0433\u043e \u043e\u0441\u043d\u043e\u0432\u0430\u043b\u0438 \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432\u0443\u044e \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/American_Express\" title=\"American Express\">American Express<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1856_%D0%B3%D0%BE%D0%B4\" title=\"1856 \u0433\u043e\u0434\">1856<\/a>&#160;\u2014 \u0417\u0430\u0432\u0435\u0440\u0448\u0430\u0435\u0442\u0441\u044f \u043a\u0440\u0430\u0439\u043d\u0435 \u043d\u0435\u0443\u0434\u0430\u0447\u043d\u0430\u044f \u0434\u043b\u044f \u0420\u043e\u0441\u0441\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a> \u0441 \u0424\u0440\u0430\u043d\u0446\u0438\u0435\u0439, \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439, \u0422\u0443\u0440\u0446\u0438\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a>&#160;\u2014 \u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043a\u043e\u043d\u0432\u0435\u043d\u0446\u0438\u0438 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0435\u0439<\/a>, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%85%D0%B0%D0%BB%D0%B8%D0%BD\" title=\"\u0421\u0430\u0445\u0430\u043b\u0438\u043d\">\u0421\u0430\u0445\u0430\u043b\u0438\u043d<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u043b\u0441\u044f \u0441\u043e\u0441\u0442\u043e\u044f\u0449\u0438\u043c \u0432\u043f\u0440\u0435\u0434\u044c \u0432 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e\u043c \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0438 \u0420\u043e\u0441\u0441\u0438\u0438 \u0438 \u042f\u043f\u043e\u043d\u0438\u0438. \u0417\u0430 \u0440\u0443\u0441\u0441\u043a\u0438\u043c\u0438 \u0438 \u044f\u043f\u043e\u043d\u0446\u0430\u043c\u0438 \u043f\u0440\u0438\u0437\u043d\u0430\u0432\u0430\u043b\u043e\u0441\u044c \u043f\u0440\u0430\u0432\u043e \u0441\u0435\u043b\u0438\u0442\u044c\u0441\u044f \u0438 \u0432\u043e\u0437\u0432\u043e\u0434\u0438\u0442\u044c \u043f\u043e\u0441\u0442\u0440\u043e\u0439\u043a\u0438 \u0432 \u043d\u0435\u0437\u0430\u043d\u044f\u0442\u044b\u0445 \u043c\u0435\u0441\u0442\u0430\u0445 \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u043e\u0441\u0442\u0440\u043e\u0432\u0430. \u041f\u0440\u043e\u0432\u0430\u043b \u043f\u043e\u043f\u044b\u0442\u043a\u0438 \u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u0442\u044c \u043a\u043e\u043b\u043e\u043d\u0438\u0437\u0430\u0446\u0438\u044e \u0421\u0430\u0445\u0430\u043b\u0438\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869_%D0%B3%D0%BE%D0%B4\" title=\"1869 \u0433\u043e\u0434\">1869<\/a>&#160;\u2014 \u041d\u0430 \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE%D0%B5_%D1%84%D0%B8%D0%B7%D0%B8%D0%BA%D0%BE-%D1%85%D0%B8%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D0%BE%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e\u0435 \u0444\u0438\u0437\u0438\u043a\u043e-\u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e\">\u0420\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BD%D1%88%D1%83%D1%82%D0%BA%D0%B8%D0%BD,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0435\u043d\u0448\u0443\u0442\u043a\u0438\u043d, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u041d.&#160;\u0410.&#160;\u041c\u0435\u043d\u0448\u0443\u0442\u043a\u0438\u043d\u044b\u043c<\/a> \u043e\u0442 \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BD%D0%B4%D0%B5%D0%BB%D0%B5%D0%B5%D0%B2,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0435\u043d\u0434\u0435\u043b\u0435\u0435\u0432, \u0414\u043c\u0438\u0442\u0440\u0438\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0414.&#160;\u0418.&#160;\u041c\u0435\u043d\u0434\u0435\u043b\u0435\u0435\u0432\u0430<\/a> \u0441\u0434\u0435\u043b\u0430\u043d\u043e \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u0435 \u043e\u0431 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0438 \u0441\u043e\u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u043c\u0435\u0436\u0434\u0443 \u0441\u0432\u043e\u0439\u0441\u0442\u0432\u0430\u043c\u0438 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432 \u0438 \u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%82%D0%BE%D0%BC%D0%BD%D0%B0%D1%8F_%D0%BC%D0%B0%D1%81%D1%81%D0%B0\" title=\"\u0410\u0442\u043e\u043c\u043d\u0430\u044f \u043c\u0430\u0441\u0441\u0430\">\u0430\u0442\u043e\u043c\u043d\u044b\u043c\u0438 \u0432\u0435\u0441\u0430\u043c\u0438<\/a> (\u043f\u043e\u043b\u0443\u0447\u0438\u0432\u0448\u0435\u0433\u043e \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0441\u0442\u044c \u043f\u043e\u0434 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B8%D0%BE%D0%B4%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D1%85%D0%B8%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D1%8D%D0%BB%D0%B5%D0%BC%D0%B5%D0%BD%D1%82%D0%BE%D0%B2\" title=\"\u041f\u0435\u0440\u0438\u043e\u0434\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432\">\u041f\u0435