\u0438\u0436\u0430\u0431\u043b\u0435\u0439<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%BE-%D1%82%D1%83%D1%80%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0418\u0442\u0430\u043b\u043e-\u0442\u0443\u0440\u0435\u0446\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0432\u043e\u0439\u043d\u0435<\/a>: \u043d\u0430 \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0445 \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044f\u0445 \u0420-1 \u0438 \u0420-3 \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BA%D0%BE%D0%B3%D0%BD%D0%BE%D1%81%D1%86%D0%B8%D1%80%D0%BE%D0%B2%D0%BA%D0%B0_(%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%B4%D0%B5%D0%BB%D0%BE)\" title=\"\u0420\u0435\u043a\u043e\u0433\u043d\u043e\u0441\u0446\u0438\u0440\u043e\u0432\u043a\u0430 (\u0432\u043e\u0435\u043d\u043d\u043e\u0435 \u0434\u0435\u043b\u043e)\">\u0440\u0435\u043a\u043e\u0433\u043d\u043e\u0441\u0446\u0438\u0440\u043e\u0432\u043a\u0430<\/a> \u0442\u0443\u0440\u0435\u0446\u043a\u0438\u0445 \u043f\u043e\u0437\u0438\u0446\u0438\u0439 \u0432\u0431\u043b\u0438\u0437\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%BF%D0%BE%D0%BB%D0%B8\" title=\"\u0422\u0440\u0438\u043f\u043e\u043b\u0438\">\u0422\u0440\u0438\u043f\u043e\u043b\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D1%8F%D1%80%D1%81%D0%BA\" title=\"\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\">\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a<\/a> \u043f\u0440\u0438\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u0442\u0432\u043e\">\u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u0442\u0432\u043e<\/a>: \u0437\u0430\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u0441\u0442\u0430\u043d\u0446\u0438\u044f\">\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u0441\u0442\u0430\u043d\u0446\u0438\u044f<\/a>, \u0430 \u043d\u0430 \u0443\u043b\u0438\u0446\u0430\u0445 \u0438 \u0432 \u0434\u043e\u043c\u0430\u0445 \u0433\u043e\u0440\u043e\u0434\u0430 \u0437\u0430\u0436\u0433\u043b\u0438\u0441\u044c \u043f\u0435\u0440\u0432\u044b\u0435 262 \u043b\u0430\u043c\u043f\u043e\u0447\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913_%D0%B3%D0%BE%D0%B4\" title=\"1913 \u0433\u043e\u0434\">1913<\/a>&#160;\u2014 \u0423\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D1%81%D1%81%D0%B0%D0%BB%D0%BE%D0%BD%D0%B8%D0%BA%D0%B8\" class=\"mw-redirect\" title=\"\u0424\u0435\u0441\u0441\u0430\u043b\u043e\u043d\u0438\u043a\u0438\">\u0424\u0435\u0441\u0441\u0430\u043b\u043e\u043d\u0438\u043a\u0430\u0445<\/a> \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u0438\u043c \u0442\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u043e\u043c-\u043e\u0434\u0438\u043d\u043e\u0447\u043a\u043e\u0439 \u0431\u0440\u0430\u0442\u0430 \u0412\u0434\u043e\u0432\u0441\u0442\u0432\u0443\u044e\u0449\u0435\u0439 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u044b\u043d\u0438 \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b \u041c\u0430\u0440\u0438\u0438 \u0424\u0435\u043e\u0434\u043e\u0440\u043e\u0432\u043d\u044b \u0438 \u0434\u044f\u0434\u0438 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u044f \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f II<\/a> \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%93%D1%80%D0%B5%D1%86%D0%B8%D0%B8\" title=\"\u041a\u043e\u0440\u043e\u043b\u044c \u0413\u0440\u0435\u0446\u0438\u0438\">\u0413\u0440\u0435\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BE%D1%80%D0%B3_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%93%D1%80%D0%B5%D1%86%D0%B8%D0%B8)\" title=\"\u0413\u0435\u043e\u0440\u0433 I (\u043a\u043e\u0440\u043e\u043b\u044c \u0413\u0440\u0435\u0446\u0438\u0438)\">\u0413\u0435\u043e\u0440\u0433\u0430 I.<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a><ul><li>\u041f\u043e\u0431\u0435\u0434\u0430 \u0442\u0443\u0440\u0435\u0446\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u043f\u0440\u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%90%D0%BD%D0%B0%D1%84%D0%B0%D1%80%D1%82%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0410\u043d\u0430\u0444\u0430\u0440\u0442\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0410\u043d\u0430\u0444\u0430\u0440\u0442\u0430\u0445<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BB%D0%B8%D0%B1%D0%BE%D0%BB%D1%83\" title=\"\u0413\u0435\u043b\u0438\u0431\u043e\u043b\u0443\">\u0413\u0430\u043b\u043b\u0438\u043f\u043e\u043b\u0438<\/a>.<\/li><li>\u0412 \u0444\u0438\u043b\u044c\u043c\u043e\u0433\u0440\u0430\u0444\u0438\u044e \u043a\u043e\u043c\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D1%80%D0%BB%D0%B8_%D0%A7%D0%B0%D0%BF%D0%BB%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u0427\u0430\u0440\u043b\u0438 \u0427\u0430\u043f\u043b\u0438\u043d\">\u0427\u0430\u0440\u043b\u0438 \u0427\u0430\u043f\u043b\u0438\u043d\u0430<\/a> \u0434\u043e\u0431\u0430\u0432\u0438\u043b\u0441\u044f \u0444\u0438\u043b\u044c\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92_%D0%BF%D0%B0%D1%80%D0%BA%D0%B5_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_1915)\" title=\"\u0412 \u043f\u0430\u0440\u043a\u0435 (\u0444\u0438\u043b\u044c\u043c, 1915)\">\u0412 \u043f\u0430\u0440\u043a\u0435<\/a>\u00bb (In the Park).<\/li><li>\u0411\u044b\u043b\u0430 \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%BE%D0%B9_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8\" title=\"\u0418\u0441\u0442\u043e\u0440\u0438\u044f \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438\">\u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438<\/a> \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u0430\u044f \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\u043d\u0430\u044f (\u0437\u0435\u043d\u0438\u0442\u043d\u0430\u044f) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%82%D0%B0%D1%80%D0%B5%D1%8F_(%D0%B0%D1%80%D0%BC%D0%B8%D1%8F)\" title=\"\u0411\u0430\u0442\u0430\u0440\u0435\u044f (\u0430\u0440\u043c\u0438\u044f)\">\u0431\u0430\u0442\u0430\u0440\u0435\u044f<\/a> \u0434\u043b\u044f \u0441\u0442\u0440\u0435\u043b\u044c\u0431\u044b \u043f\u043e \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u043c \u0446\u0435\u043b\u044f\u043c.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a><ul><li>\u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u0438\u0435 \u0432 \u00ab\u0412\u0435\u0441\u0442\u043d\u0438\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0420\u043e\u0441\u0441\u0438\u0438\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430<\/a>\u00bb \u0410\u043a\u0442\u043e\u0432 \u043e\u0431 \u043e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u0438 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u044f \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f II<\/a> \u0438 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u041a\u043d\u044f\u0437\u044f \u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\u0430.<\/li><li>\u0410\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B0%D1%80%D1%8C\" title=\"\u0426\u0430\u0440\u044c\">\u0446\u0430\u0440\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II<\/a>.<\/li><li>\u041d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0432\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0435 \u0441\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D1%80%D0%B0%D0%B1%D0%BE%D1%87%D0%B8%D1%85_%D0%B8_%D1%81%D0%BE%D0%BB%D0%B4%D0%B0%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%B4%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82%D0%BE%D0%B2\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0438 \u0441\u043e\u043b\u0434\u0430\u0442\u0441\u043a\u0438\u0445 \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432\">\u0421\u043e\u0432\u0435\u0442\u043e\u0432 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0438 \u0441\u043e\u043b\u0434\u0430\u0442\u0441\u043a\u0438\u0445 \u0434\u0435\u043f\u0443\u0442\u0430\u0442\u043e\u0432<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u0431\u044b\u043b \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d \u0432\u044b\u0445\u043e\u0434 \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u043d\u043e\u0439 \u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%B4%D0%B0_(%D0%B3%D0%B0%D0%B7%D0%B5%D1%82%D0%B0)\" title=\"\u041f\u0440\u0430\u0432\u0434\u0430 (\u0433\u0430\u0437\u0435\u0442\u0430)\">\u041f\u0440\u0430\u0432\u0434\u0430<\/a>\u00bb.<\/li><li>\u041f\u0440\u0438\u043a\u0430\u0437\u043e\u043c \u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430<\/a> \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0413\u0443\u0447\u043a\u043e\u0432\u0430 \u0431\u044b\u043b\u0438 \u043e\u0442\u043c\u0435\u043d\u0435\u043d\u044b \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0441\u0442\u0430\u0442\u044c\u0438 \u0432\u043e\u0438\u043d\u0441\u043a\u0438\u0445 \u0443\u0441\u0442\u0430\u0432\u043e\u0432. \u0422\u0430\u043a, \u043e\u0444\u0438\u0446\u0435\u0440\u044b \u0442\u0435\u043f\u0435\u0440\u044c \u0434\u043e\u043b\u0436\u043d\u044b \u0431\u044b\u043b\u0438 \u043e\u0431\u0440\u0430\u0449\u0430\u0442\u044c\u0441\u044f \u043a \u0441\u043e\u043b\u0434\u0430\u0442\u0430\u043c \u043d\u0430 \u00ab\u0432\u044b\u00bb. \u0411\u044b\u043b\u043e \u0443\u043f\u0440\u0430\u0437\u0434\u043d\u0435\u043d\u043e \u043f\u043e\u043d\u044f\u0442\u0438\u0435 \u00ab\u043d\u0438\u0436\u043d\u0438\u0439 \u0447\u0438\u043d\u00bb, \u043e\u0442\u043c\u0435\u043d\u0435\u043d\u043e \u043e\u0442\u0434\u0430\u043d\u0438\u0435 \u0447\u0435\u0441\u0442\u0438 \u0438, \u043f\u0440\u043e\u0447\u0438\u0435, \u043a\u0430\u043a \u0442\u043e\u0433\u0434\u0430 \u0433\u043e\u0432\u043e\u0440\u0438\u043b\u0438, \u00ab\u0441\u0442\u0430\u0440\u043e\u0440\u0435\u0436\u0438\u043c\u043d\u044b\u0435 \u043f\u043e\u0440\u044f\u0434\u043a\u0438\u00bb, \u0443\u0449\u0435\u043c\u043b\u044f\u044e\u0449\u0438\u0435 \u043f\u0440\u0430\u0432\u0430 \u00ab\u043f\u0440\u043e\u0441\u0442\u043e\u0433\u043e \u0432\u043e\u044f\u043a\u0438\u00bb.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u0435\u0440\u0432\u0430\u044f \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BC%D0%BD%D0%B0%D0%B7%D0%B8%D1%8F\" title=\"\u0413\u0438\u043c\u043d\u0430\u0437\u0438\u044f\">\u0433\u0438\u043c\u043d\u0430\u0437\u0438\u044f<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a><ul><li>\u041f\u0440\u0438\u043d\u044f\u0442\u043e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%BD%D0%B0%D1%80%D0%BA%D0%BE%D0%BC\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c\">\u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c\u0430<\/a> \u043e\u0431 \u043e\u0445\u0440\u0430\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D1%81%D0%BD%D0%B0%D1%8F_%D0%9F%D0%BE%D0%BB%D1%8F%D0%BD%D0%B0\" title=\"\u042f\u0441\u043d\u0430\u044f \u041f\u043e\u043b\u044f\u043d\u0430\">\u042f\u0441\u043d\u043e\u0439 \u041f\u043e\u043b\u044f\u043d\u044b<\/a> \u0438 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0435 \u0438\u043c\u0435\u043d\u0438\u044f \u0432 \u043f\u043e\u0436\u0438\u0437\u043d\u0435\u043d\u043d\u043e\u0435 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u0421\u043e\u0444\u044c\u0435 \u0410\u043d\u0434\u0440\u0435\u0435\u0432\u043d\u0435 \u0422\u043e\u043b\u0441\u0442\u043e\u0439.<\/li><li>\u0412\u044b\u0448\u043b\u043e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%BD%D0%B0%D1%80%D0%BA%D0%BE%D0%BC\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c\">\u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c\u0430<\/a> \u043e \u0437\u0430\u043a\u0440\u044b\u0442\u0438\u0438 \u043c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0445 \u0431\u0443\u0440\u0436\u0443\u0430\u0437\u043d\u044b\u0445 \u0433\u0430\u0437\u0435\u0442 \u00ab\u0441 \u043f\u0440\u0435\u0434\u0430\u043d\u0438\u0435\u043c \u0440\u0435\u0434\u0430\u043a\u0442\u043e\u0440\u043e\u0432 \u0438 \u0438\u0437\u0434\u0430\u0442\u0435\u043b\u0435\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u043e\u043c\u0443 \u0441\u0443\u0434\u0443 \u0438 \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u0435\u043c \u043a \u043d\u0438\u043c \u0441\u0430\u043c\u044b\u0445 \u0441\u0443\u0440\u043e\u0432\u044b\u0445 \u043c\u0435\u0440 \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u044f\u00bb.<\/li><li>\u0421\u0442\u0440\u0430\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B0%D0%BD%D1%82%D0%B0\" title=\"\u0410\u043d\u0442\u0430\u043d\u0442\u0430\">\u0410\u043d\u0442\u0430\u043d\u0442\u044b<\/a> \u0437\u0430\u044f\u0432\u0438\u043b\u0438 \u043e \u043d\u0435\u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u0438 \u0438\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D1%81%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u0411\u0440\u0435\u0441\u0442\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0411\u0440\u0435\u0441\u0442\u0441\u043a\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b \u0441\u0432\u043e\u044e \u0440\u0430\u0431\u043e\u0442\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/VIII_%D1%81%D1%8A%D0%B5%D0%B7%D0%B4_%D0%A0%D0%9A%D0%9F(%D0%B1)\" title=\"VIII \u0441\u044a\u0435\u0437\u0434 \u0420\u041a\u041f(\u0431)\">VIII \u0441\u044a\u0435\u0437\u0434 \u0420\u041a\u041f(\u0431)<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u041b\u0435\u043d\u0438\u043d, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0418\u043b\u044c\u0438\u0447\">\u041b\u0435\u043d\u0438\u043d<\/a> \u043d\u0430 II \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%BD\" class=\"mw-redirect\" title=\"\u041a\u043e\u043c\u0438\u043d\u0442\u0435\u0440\u043d\">\u041a\u043e\u043c\u0438\u043d\u0442\u0435\u0440\u043d\u0430<\/a>, \u043d\u0430\u043f\u043e\u043c\u043d\u0438\u0432 \u043e \u043f\u0440\u0435\u0434\u0441\u0442\u043e\u044f\u0449\u0435\u043c \u0447\u0435\u0440\u0435\u0437 \u0433\u043e\u0434 50-\u043b\u0435\u0442\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B0\" title=\"\u041f\u0430\u0440\u0438\u0436\u0441\u043a\u0430\u044f \u043a\u043e\u043c\u043c\u0443\u043d\u0430\">\u041f\u0430\u0440\u0438\u0436\u0441\u043a\u043e\u0439 \u041a\u043e\u043c\u043c\u0443\u043d\u044b<\/a>, \u043f\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u0437\u0430\u0434\u0430\u0447\u0443: \u00ab\u041a \u044d\u0442\u043e\u043c\u0443 \u0432\u0440\u0435\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a> \u0434\u043e\u043b\u0436\u043d\u0430 \u0441\u0442\u0430\u0442\u044c \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439!\u00bb<\/li><li>\u0414\u0435\u043a\u0440\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%A6%D0%98%D0%9A\" class=\"mw-redirect\" title=\"\u0412\u0426\u0418\u041a\">\u0412\u0426\u0418\u041a<\/a>, \u0434\u0430\u044e\u0449\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%A7%D0%9A\" class=\"mw-redirect\" title=\"\u0412\u0427\u041a\">\u0412\u0427\u041a<\/a> \u043f\u0440\u0430\u0432\u043e \u0437\u0430\u043a\u043b\u044e\u0447\u0430\u0442\u044c \u043f\u043e\u0434\u043e\u0437\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043b\u0438\u0446, \u0432\u0438\u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043d\u0435 \u0434\u043e\u043a\u0430\u0437\u0430\u043d\u0430 \u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435\u043c, \u0432 \u043b\u0430\u0433\u0435\u0440\u044f \u043f\u0440\u0438\u043d\u0443\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0440\u0443\u0434\u0430 \u043d\u0430 \u0441\u0440\u043e\u043a \u043d\u0435 \u0441\u0432\u044b\u0448\u0435 5 \u043b\u0435\u0442.<\/li><li>\u0412\u044b\u0448\u0435\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0442\u0440\u0443\u0434\u00bb. \u0427\u0435\u0440\u0435\u0437 \u0434\u0432\u0430 \u0433\u043e\u0434\u0430 \u0435\u0451 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043b\u0438 \u0432 \u00ab\u0420\u0430\u0431\u043e\u0447\u0443\u044e \u041c\u043e\u0441\u043a\u0432\u0443\u00bb. \u0412 1939 \u0433\u043e\u0434 \u043e\u043d\u0430 \u0441\u0442\u0430\u043b\u0430 \u00ab\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u043c \u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u043c\u00bb, \u0430 \u0441 1950 \u0433\u043e\u0434 \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u043b\u0430 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%80%D0%B0%D0%B2%D0%B4%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0430\u044f \u043f\u0440\u0430\u0432\u0434\u0430\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0430\u044f \u043f\u0440\u0430\u0432\u0434\u0430<\/a>\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_1921\" class=\"mw-redirect\" title=\"\u0420\u0438\u0436\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 1921\">\u0420\u0438\u0436\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0420\u0421\u0424\u0421\u0420\">\u0420\u0421\u0424\u0421\u0420<\/a> (\u0442\u0430\u043a\u0436\u0435 \u043e\u0442 \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0411\u0421\u0421\u0420\">\u0411\u0421\u0421\u0420<\/a>, \u0431\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u043e\u0435 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u043d\u0435 \u0431\u044b\u043b\u043e \u043f\u0440\u043e\u0438\u043d\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043e \u043e \u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u043e\u0432) \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0423\u0421\u0421\u0420\">\u0423\u0421\u0421\u0420<\/a>, \u0441 \u043e\u0434\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b, \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0435\u0439<\/a>,&#160;\u2014 \u0441 \u0434\u0440\u0443\u0433\u043e\u0439, \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0439 \u0432 \u0420\u0438\u0433\u0435 \u0438 \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE-%D0%BF%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u043f\u043e\u043b\u044c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u043f\u043e\u043b\u044c\u0441\u043a\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a> (1919\u20141921). \u041a \u041f\u043e\u043b\u044c\u0448\u0435 \u043e\u0442\u043e\u0448\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B0%D1%8F_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0_%D0%B2_%D1%81%D0%BE%D1%81%D1%82%D0%B0%D0%B2%D0%B5_%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B8_(1921%E2%80%941939)\" title=\"\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0423\u043a\u0440\u0430\u0438\u043d\u0430 \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 \u041f\u043e\u043b\u044c\u0448\u0438 (1921\u20141939)\">\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0423\u043a\u0440\u0430\u0438\u043d\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%B0%D1%8F_%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u0438\u044f\">\u0417\u0430\u043f\u0430\u0434\u043d\u0430\u044f \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u0438\u044f<\/a>.<\/li><li>\u041c\u043e\u043d\u0433\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u043e\u043f\u043e\u043b\u0447\u0435\u043d\u0438\u0435, \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u0435\u043c\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D1%85%D1%8D-%D0%91%D0%B0%D1%82%D0%BE%D1%80,_%D0%94%D0%B0%D0%BC%D0%B4%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u0421\u0443\u0445\u044d-\u0411\u0430\u0442\u043e\u0440, \u0414\u0430\u043c\u0434\u0438\u043d\">\u0414. \u0421\u0443\u0445\u044d-\u0411\u0430\u0442\u043e\u0440\u043e\u043c<\/a>, \u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u043b\u043e \u043e\u0442 \u043a\u0438\u0442\u0430\u0439\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%82%D0%B0%D0%BD%D0%B1%D1%83%D0%BB%D0%B0%D0%B3\" title=\"\u0410\u043b\u0442\u0430\u043d\u0431\u0443\u043b\u0430\u0433\">\u0410\u043b\u0442\u0430\u043d\u0431\u0443\u043b\u0430\u0433<\/a>.<\/li><li>\u0411\u044b\u043b\u043e \u043f\u043e\u0434\u0430\u0432\u043b\u0435\u043d\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u043e\u0441\u043b\u0435 \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%82%D1%80%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u041a\u043e\u043d\u0442\u0440\u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0430\u043d\u0442\u0438\u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u0441\u0442\u0441\u043a\u043e\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B0%D0%B4%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\">\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435<\/a>. \u041a\u0440\u0430\u0441\u043d\u043e\u0430\u0440\u043c\u0435\u0439\u0446\u044b \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%85%D0%B0%D1%87%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0422\u0443\u0445\u0430\u0447\u0435\u0432\u0441\u043a\u0438\u0439, \u041c\u0438\u0445\u0430\u0438\u043b \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0422\u0443\u0445\u0430\u0447\u0435\u0432\u0441\u043a\u043e\u0433\u043e<\/a> \u0448\u0442\u0443\u0440\u043c\u043e\u043c \u0432\u0437\u044f\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%BD%D1%88%D1%82%D0%B0%D0%B4%D1%82\" title=\"\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442\">\u041a\u0440\u043e\u043d\u0448\u0442\u0430\u0434\u0442<\/a>.<\/li><li>\u0418\u0437-\u0437\u0430 \u0434\u0440\u0430\u043a\u0438 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u0430\u0440\u043e\u0445\u043e\u0434\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A5%D0%BE%D0%BD_%D0%9A%D0%BE%D1%85&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0425\u043e\u043d \u041a\u043e\u0445 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0425\u043e\u043d \u041a\u043e\u0445<\/a>\u00bb \u043e\u043d \u043f\u043e\u0442\u0435\u0440\u044f\u043b \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0438 \u0437\u0430\u0442\u043e\u043d\u0443\u043b, \u043f\u043e\u0433\u0438\u0431\u043b\u043e \u0431\u043e\u043b\u0435\u0435 \u0442\u044b\u0441\u044f\u0447\u0438 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0418\u043d\u0434\u0438\u0439\u0441\u043a\u0438\u0439 \u043b\u0438\u0434\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%85%D0%B0%D1%82%D0%BC%D0%B0_%D0%93%D0%B0%D0%BD%D0%B4%D0%B8\" title=\"\u041c\u0430\u0445\u0430\u0442\u043c\u0430 \u0413\u0430\u043d\u0434\u0438\">\u041c\u0430\u0445\u0430\u0442\u043c\u0430 \u0413\u0430\u043d\u0434\u0438<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d \u0432 \u0442\u044e\u0440\u044c\u043c\u0443 \u043d\u0430 \u0448\u0435\u0441\u0442\u044c \u043b\u0435\u0442 \u0437\u0430 \u043f\u043e\u0434\u0441\u0442\u0440\u0435\u043a\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a><ul><li>\u0423\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BF%D0%BB%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\">\u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u0435\u0439<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BC%D0%BE%D0%B9_%D1%84%D0%B8%D0%BB%D1%8C%D0%BC\" class=\"mw-redirect\" title=\"\u041d\u0435\u043c\u043e\u0439 \u0444\u0438\u043b\u044c\u043c\">\u043d\u0435\u043c\u043e\u0433\u043e \u0444\u0438\u043b\u044c\u043c\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B3%D0%B4%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%BE%D1%80_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_1924)\" title=\"\u0411\u0430\u0433\u0434\u0430\u0434\u0441\u043a\u0438\u0439 \u0432\u043e\u0440 (\u0444\u0438\u043b\u044c\u043c, 1924)\">\u0411\u0430\u0433\u0434\u0430\u0434\u0441\u043a\u0438\u0439 \u0432\u043e\u0440<\/a>\u00bb \u0441\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u044c\u044e 2&#160;\u043c\u043b\u043d \u0434\u043e\u043b\u043b\u0430\u0440\u043e\u0432.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u043e\u0433\u0440\u043e\u043c\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B5%D1%80%D1%87\" title=\"\u0421\u043c\u0435\u0440\u0447\">\u0441\u043c\u0435\u0440\u0447<\/a>, \u00ab\u0422\u0440\u0451\u0445\u0448\u0442\u0430\u0442\u043d\u044b\u0439\u00bb, \u043f\u0440\u043e\u043d\u0451\u0441\u0441\u044f \u043f\u043e \u0442\u0440\u0451\u043c \u0448\u0442\u0430\u0442\u0430\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 695, \u043f\u043e\u0441\u0442\u0440\u0430\u0434\u0430\u043b\u0438 2027 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D1%81%D1%81%D1%82%D1%80%D0%B5%D0%BB_%D0%B4%D0%B5%D0%BC%D0%BE%D0%BD%D1%81%D1%82%D1%80%D0%B0%D1%86%D0%B8%D0%B8_%D0%B2_%D0%9F%D0%B5%D0%BA%D0%B8%D0%BD%D0%B5_(1926)\" title=\"\u0420\u0430\u0441\u0441\u0442\u0440\u0435\u043b \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0432 \u041f\u0435\u043a\u0438\u043d\u0435 (1926)\">\u0420\u0430\u0441\u0441\u0442\u0440\u0435\u043b \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0432 \u041f\u0435\u043a\u0438\u043d\u0435<\/a>. \u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0438\u0439 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83_%D0%A1%D0%B8%D0%BD%D1%8C\" title=\"\u041b\u0443 \u0421\u0438\u043d\u044c\">\u041b\u0443 \u0421\u0438\u043d\u044c<\/a> \u043d\u0430\u0437\u0432\u0430\u043b \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u00ab\u043c\u0440\u0430\u0447\u043d\u0435\u0439\u0448\u0438\u043c \u0434\u043d\u0451\u043c \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1931_%D0%B3%D0%BE%D0%B4\" title=\"1931 \u0433\u043e\u0434\">1931<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f Schick \u043d\u0430\u0447\u0430\u043b\u0430 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u043f\u0435\u0440\u0432\u044b\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B