1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u0438\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>: \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u043e\u0441\u044c \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u043e\u0434 \u0413\u0432\u0430\u0434\u0430\u043b\u0430\u0445\u0430\u0440\u043e\u0439, \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0446\u044b \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b\u0438 \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u043a\u043e\u0440\u043f\u0443\u0441 \u0438 \u0437\u0430\u043d\u044f\u043b\u0438 \u0433. \u0411\u0440\u0438\u0443\u044d\u0433\u0443, \u0442\u0435\u043c \u0441\u0430\u043c\u044b\u043c \u0441\u043d\u044f\u0432 \u0443\u0433\u0440\u043e\u0437\u0443 \u043e\u043a\u0440\u0443\u0436\u0435\u043d\u0438\u044f \u041c\u0430\u0434\u0440\u0438\u0434\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438<\/a> \u0438\u0437 \u043b\u0451\u0442\u0447\u0438\u043a\u043e\u0432, \u0432\u043e\u0435\u0432\u0430\u0432\u0448\u0438\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>, \u0434\u043b\u044f \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u0438\u044f \u043e\u0441\u043e\u0431\u044b\u0445 \u0437\u0430\u0434\u0430\u0447 \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d 19-\u0439 \u0438\u0441\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043f\u043e\u043b\u043a, \u043e\u0434\u0438\u043d \u0438\u0437 \u043d\u0430\u0438\u0431\u043e\u043b\u0435\u0435 \u043e\u0442\u043b\u0438\u0447\u0438\u0432\u0448\u0438\u0445\u0441\u044f \u0432 \u043f\u0435\u0440\u0438\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%9E%D1%82%D0%B5%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u041e\u0442\u0435\u0447\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8E%D0%BD%D1%85%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D0%BE%D0%B3%D0%BB%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041c\u044e\u043d\u0445\u0435\u043d\u0441\u043a\u043e\u0435 \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435\">\u041c\u044e\u043d\u0445\u0435\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u044f<\/a> \u0412\u0435\u043d\u0433\u0440\u0438\u044f \u0437\u0430\u0445\u0432\u0430\u0442\u044b\u0432\u0430\u0435\u0442 \u042e\u0436\u043d\u0443\u044e \u0421\u043b\u043e\u0432\u0430\u043a\u0438\u044e \u0438 \u0417\u0430\u043a\u0430\u0440\u043f\u0430\u0442\u0441\u043a\u0443\u044e \u0423\u043a\u0440\u0430\u0438\u043d\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 \u041d\u0430 \u0432\u0441\u0442\u0440\u0435\u0447\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B5%D0%BD%D0%BD%D0%B5%D1%80_(%D0%BF%D0%B5%D1%80%D0%B5%D0%B2%D0%B0%D0%BB)\" title=\"\u0411\u0440\u0435\u043d\u043d\u0435\u0440 (\u043f\u0435\u0440\u0435\u0432\u0430\u043b)\">\u0411\u0440\u0435\u043d\u043d\u0435\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440, \u0410\u0434\u043e\u043b\u044c\u0444\">\u0413\u0438\u0442\u043b\u0435\u0440<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%81%D1%81%D0%BE%D0%BB%D0%B8%D0%BD%D0%B8,_%D0%91%D0%B5%D0%BD%D0%B8%D1%82%D0%BE\" title=\"\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438, \u0411\u0435\u043d\u0438\u0442\u043e\">\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438<\/a> \u043e\u0431\u0441\u0443\u0434\u0438\u043b\u0438 \u0432\u043e\u043f\u0440\u043e\u0441 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u0438 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044f \u0441\u043e\u044e\u0437\u0430 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 120 \u0442\u044b\u0441\u044f\u0447 \u0433\u0440\u0430\u0436\u0434\u0430\u043d \u0421\u0428\u0410 \u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0434\u0435\u043f\u043e\u0440\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u044b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%86%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B5_%D0%BB%D0%B0%D0%B3%D0%B5%D1%80%D1%8F\" class=\"mw-redirect\" title=\"\u041a\u043e\u043d\u0446\u0435\u043d\u0442\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0435 \u043b\u0430\u0433\u0435\u0440\u044f\">\u043a\u043e\u043d\u0446\u0435\u043d\u0442\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0435 \u043b\u0430\u0433\u0435\u0440\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u041f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u042f\u043f\u043e\u043d\u0438\u0438\">\u041f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u0437\u0430\u043a\u0440\u044b\u0432\u0430\u0435\u0442 \u0448\u043a\u043e\u043b\u044b, \u043f\u0440\u0438\u0437\u044b\u0432\u0430\u044f \u043d\u0430 \u0432\u043e\u0435\u043d\u043d\u0443\u044e \u0441\u043b\u0443\u0436\u0431\u0443 \u0432\u0441\u0435\u0445 \u0434\u0435\u0442\u0435\u0439 \u0441\u0442\u0430\u0440\u0448\u0435 \u0448\u0435\u0441\u0442\u0438 \u043b\u0435\u0442.<\/li><li>\u0410\u043d\u0433\u043b\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0430\u0432\u0438\u0430\u0446\u0438\u044f \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b\u0430 \u0441\u0430\u043c\u044b\u0439 \u043c\u043e\u0449\u043d\u044b\u0439 \u043d\u0430\u043b\u0451\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d<\/a>. 1300 \u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u0449\u0438\u043a\u043e\u0432 \u0432 \u0441\u043e\u043f\u0440\u043e\u0432\u043e\u0436\u0434\u0435\u043d\u0438\u0438 750 \u0438\u0441\u0442\u0440\u0435\u0431\u0438\u0442\u0435\u043b\u0435\u0439 \u0434\u0432\u0430 \u0447\u0430\u0441\u0430 \u0431\u043e\u043c\u0431\u0438\u043b\u0438 \u0441\u0442\u043e\u043b\u0438\u0446\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D1%85\" title=\"\u0420\u0435\u0439\u0445\">\u0440\u0435\u0439\u0445\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a><ul><li>\u041f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D0%B2%D0%B5%D1%82_%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0441\u043e\u0432\u0435\u0442 \u0421\u0421\u0421\u0420\">\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u043c \u0421\u043e\u0432\u0435\u0442\u043e\u043c \u0421\u0421\u0421\u0420<\/a> \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043f\u043e\u0441\u043b\u0435\u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u044f\u0442\u0438\u043b\u0435\u0442\u043d\u0435\u0433\u043e \u043f\u043b\u0430\u043d\u0430&#160;\u2014 \u0417\u0430\u043a\u043e\u043d\u0430 \u00ab\u041e \u043f\u044f\u0442\u0438\u043b\u0435\u0442\u043d\u0435\u043c \u043f\u043b\u0430\u043d\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430 \u0421\u0421\u0421\u0420 \u043d\u0430 1946\u20141950&#160;\u0433\u0433.\u00bb.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD_(%D0%BE%D0%BA%D