edia.org\/wiki\/1952_%D0%B3%D0%BE%D0%B4\" title=\"1952 \u0433\u043e\u0434\">1952<\/a> \u0433. \u0438 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u043d\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%A1%D0%BE%D1%8E%D0%B7\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u0421\u043e\u044e\u0437\">\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u043c \u0421\u043e\u044e\u0437\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/31_%D0%BC%D0%B0%D1%80%D1%82%D0%B0\" title=\"31 \u043c\u0430\u0440\u0442\u0430\">31 \u043c\u0430\u0440\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953_%D0%B3%D0%BE%D0%B4\" title=\"1953 \u0433\u043e\u0434\">1953<\/a> \u0433., \u0441 \u043e\u0433\u043e\u0432\u043e\u0440\u043a\u0430\u043c\u0438, \u0441\u0434\u0435\u043b\u0430\u043d\u043d\u044b\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u043f\u0440\u0438 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0438 \u043f\u043e \u0441\u0442\u0430\u0442\u044c\u044f\u043c VII \u0438 IX \u041a\u043e\u043d\u0432\u0435\u043d\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a>&#160;\u2014 \u0412 \u041c\u043e\u0441\u043a\u0432\u0435 \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f \u041f\u0435\u0440\u0432\u044b\u0439 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%BA%D1%83%D1%80%D1%81_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%A7%D0%B0%D0%B9%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE\" class=\"mw-redirect\" title=\"\u041a\u043e\u043d\u043a\u0443\u0440\u0441 \u0438\u043c\u0435\u043d\u0438 \u0427\u0430\u0439\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e\">\u043a\u043e\u043d\u043a\u0443\u0440\u0441 \u043c\u0443\u0437\u044b\u043a\u0430\u043d\u0442\u043e\u0432-\u0438\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u0435\u0439 \u0438\u043c\u0435\u043d\u0438 \u041f.&#160;\u0418.&#160;\u0427\u0430\u0439\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e<\/a>. \u041f\u0435\u0440\u0432\u043e\u0435 \u043c\u0435\u0441\u0442\u043e \u0441\u0440\u0435\u0434\u0438 \u043f\u0438\u0430\u043d\u0438\u0441\u0442\u043e\u0432 \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u043b \u043f\u0438\u0430\u043d\u0438\u0441\u0442 \u0438\u0437 \u0421\u0428\u0410 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD_%D0%9A%D0%BB%D0%B8%D0%B1%D0%B5%D1%80%D0%BD\" class=\"mw-redirect\" title=\"\u0412\u0430\u043d \u041a\u043b\u0438\u0431\u0435\u0440\u043d\">\u0412\u0430\u043d \u041a\u043b\u0438\u0431\u0435\u0440\u043d<\/a>. \u0421\u0440\u0435\u0434\u0438 \u0441\u043a\u0440\u0438\u043f\u0430\u0447\u0435\u0439 \u043f\u0435\u0440\u0432\u0443\u044e \u043f\u0440\u0435\u043c\u0438\u044e \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u043b \u0441\u043a\u0440\u0438\u043f\u0430\u0447 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B8%D0%BC%D0%BE%D0%B2,_%D0%92%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87_(%D1%81%D0%BA%D1%80%D0%B8%D0%BF%D0%B0%D1%87)\" title=\"\u041a\u043b\u0438\u043c\u043e\u0432, \u0412\u0430\u043b\u0435\u0440\u0438\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447 (\u0441\u043a\u0440\u0438\u043f\u0430\u0447)\">\u0412.&#160;\u0410.&#160;\u041a\u043b\u0438\u043c\u043e\u0432<\/a> \u0438\u0437 \u0421\u0421\u0421\u0420.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960_%D0%B3%D0%BE%D0%B4\" title=\"1960 \u0433\u043e\u0434\">1960<\/a><ul><li>\u0412 \u044d\u0444\u0438\u0440 \u0432\u044b\u0448\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0430 \u00ab\u0422\u0435\u043b\u0435\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u043e\u0433\u043e \u043a\u043b\u0443\u0431\u0430 \u043a\u0438\u043d\u043e\u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0439\u00bb (\u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D1%83%D0%B1_%D0%BF%D1%83%D1%82%D0%B5%D1%88%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2\" title=\"\u041a\u043b\u0443\u0431 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a\u043e\u0432\">\u041a\u043b\u0443\u0431\u0430 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a\u043e\u0432<\/a>\u00bb). \u0421\u043e\u0437\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u0438 \u043f\u0435\u0440\u0432\u044b\u043c \u0435\u0451 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0431\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BD%D0%B5%D0%B9%D0%B4%D0%B5%D1%80%D0%BE%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0428\u043d\u0435\u0439\u0434\u0435\u0440\u043e\u0432, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0410\u0434\u043e\u043b\u044c\u0444\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0410\u0434\u043e\u043b\u044c\u0444\u043e\u0432\u0438\u0447 \u0428\u043d\u0435\u0439\u0434\u0435\u0440\u043e\u0432<\/a>, \u043d\u0435\u0443\u0442\u043e\u043c\u0438\u043c\u044b\u0439 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a, \u043f\u0440\u043e\u0448\u0435\u0434\u0448\u0438\u0439 \u0438 \u043f\u0440\u043e\u0435\u0445\u0430\u0432\u0448\u0438\u0439 \u0437\u0430 \u0441\u0432\u043e\u044e \u0436\u0438\u0437\u043d\u044c \u0431\u043e\u043b\u0435\u0435 500 \u0442\u044b\u0441\u044f\u0447 \u043a\u0438\u043b\u043e\u043c\u0435\u0442\u0440\u043e\u0432 \u043f\u043e \u043d\u0435\u0438\u0437\u0432\u0435\u0434\u0430\u043d\u043d\u044b\u043c \u0434\u0430\u043b\u0451\u043a\u0438\u043c \u043c\u0435\u0441\u0442\u0430\u043c, \u0440\u0435\u0436\u0438\u0441\u0441\u0451\u0440, \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u0436\u0430\u043d\u0440\u0430 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u043e-\u043f\u0440\u0438\u043a\u043b\u044e\u0447\u0435\u043d\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0444\u0438\u043b\u044c\u043c\u0430. \u0421 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973_%D0%B3%D0%BE%D0%B4\" title=\"1973 \u0433\u043e\u0434\">1973 \u0433\u043e\u0434\u0430<\/a> \u0432\u0435\u0434\u0443\u0449\u0438\u043c \u0434\u043e \u0441\u0430\u043c\u043e\u0439 \u0441\u043c\u0435\u0440\u0442\u0438 \u0432 2003 \u0433\u043e\u0434\u0443 \u044f\u0432\u043b\u044f\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BD%D0%BA%D0%B5%D0%B2%D0%B8%D1%87,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0435\u043d\u043a\u0435\u0432\u0438\u0447, \u042e\u0440\u0438\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u042e\u0440\u0438\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447 \u0421\u0435\u043d\u043a\u0435\u0432\u0438\u0447<\/a>. \u0412\u043d\u0435\u0441\u0435\u043d\u0430 \u0432 \u00ab\u041a\u043d\u0438\u0433\u0443 \u0440\u0435\u043a\u043e\u0440\u0434\u043e\u0432 \u0413\u0438\u043d\u043d\u0435\u0441\u0430\u00bb \u043a\u0430\u043a \u0441\u0442\u0430\u0440\u0435\u0439\u0448\u0430\u044f \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0442\u0435\u043b\u0435\u0432\u0438\u0434\u0435\u043d\u0438\u044f.<\/li><li>\u0417\u0430\u0432\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Swindon_Works\" title=\"Swindon Works\">Swindon Works<\/a> \u0432\u044b\u043f\u0443\u0441\u0442\u0438\u043b \u043f\u043e\u0441\u043b\u0435