u0438\u0439.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984_%D0%B3%D0%BE%D0%B4\" title=\"1984 \u0433\u043e\u0434\">1984<\/a>&#160;\u2014 \u041e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0434\u0435\u043d\u044c \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u0433\u0440\u0443\u043f\u043f\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B2%D0%BE\" title=\"\u0411\u0440\u0430\u0432\u043e\">\u0411\u0440\u0430\u0432\u043e<\/a>\u00bb. \u0412 \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u0432 \u0414\u041a \u00ab\u041c\u043e\u0441\u044d\u043d\u0435\u0440\u0433\u043e\u0442\u0435\u0445\u043f\u0440\u043e\u043c\u00bb \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043f\u0435\u0447\u0430\u043b\u044c\u043d\u043e \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u044b\u0439 \u043a\u043e\u043d\u0446\u0435\u0440\u0442 \u0433\u0440\u0443\u043f\u043f\u044b, \u0433\u043b\u0430\u0432\u043d\u044b\u043c\u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u043c\u0438 \u043b\u0438\u0446\u0430\u043c\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0441\u0442\u0430\u043b\u0438 \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u043a\u0438 \u043f\u0440\u0430\u0432\u043e\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u043e\u0432, \u0430 \u0444\u0438\u043d\u0430\u043b\u044c\u043d\u0430\u044f \u043a\u043e\u0434\u0430 \u043f\u0440\u043e\u0437\u0432\u0443\u0447\u0430\u043b\u0430 \u0432 \u043c\u0435\u0441\u0442\u043d\u043e\u043c \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u0438 \u043c\u0438\u043b\u0438\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 \u0433\u043e\u0434\">1987<\/a>&#160;\u2014 \u041f\u043e\u0436\u0430\u0440 \u0438 \u0432\u044b\u0431\u0440\u043e\u0441 \u0440\u0430\u0434\u0438\u043e\u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438 \u0432 \u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0439\u0441\u043a\u043e\u043c \u044f\u0434\u0435\u0440\u043d\u043e\u043c \u0446\u0435\u043d\u0442\u0440\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988_%D0%B3%D0%BE%D0%B4\" title=\"1988 \u0433\u043e\u0434\">1988<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%90%D0%A0\" class=\"mw-redirect\" title=\"\u042e\u0410\u0420\">\u042e\u0410\u0420<\/a> \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u0430 \u0441\u0430\u043c\u0430\u044f \u0431\u043e\u043b\u044c\u0448\u0430\u044f \u0431\u0443\u0445\u0430\u043d\u043a\u0430 \u0445\u043b\u0435\u0431\u0430 \u0432 \u043c\u0438\u0440\u0435 (\u0432\u0435\u0441 1,43 \u0442\u043e\u043d\u043d\u044b).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u0441\u044f \u043e\u0447\u0435\u0440\u0435\u0434\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D1%83%D0%B7%D0%B8%D0%BD%D0%BE-%D0%B0%D0%B1%D1%85%D0%B0%D0%B7%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BD%D1%84%D0%BB%D0%B8%D0%BA%D1%82\" title=\"\u0413\u0440\u0443\u0437\u0438\u043d\u043e-\u0430\u0431\u0445\u0430\u0437\u0441\u043a\u0438\u0439 \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442\">\u0433\u0440\u0443\u0437\u0438\u043d\u043e-\u0430\u0431\u0445\u0430\u0437\u0441\u043a\u0438\u0439 \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442<\/a>. \u0412 \u0441\u0435\u043b\u0435 \u041b\u044b\u0445\u043d\u044b \u0413\u0443\u0434\u0430\u0443\u0442\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0439\u043e\u043d\u0430 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f \u043c\u043d\u043e\u0433\u043e\u0442\u044b\u0441\u044f\u0447\u043d\u044b\u0439 \u043c\u0438\u0442\u0438\u043d\u0433-\u0441\u0445\u043e\u0434, \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043f\u0440\u0438\u043d\u044f\u043b\u0438 \u041e\u0431\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u043a \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u044f\u0449\u0438\u043c \u043e\u0440\u0433\u0430\u043d\u0430\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0441 \u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0432\u0435\u0440\u043d\u0443\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D1%85%D0%B0%D0%B7%D0%B8%D1%8F\" title=\"\u0410\u0431\u0445\u0430\u0437\u0438\u044f\">\u0410\u0431\u0445\u0430\u0437\u0438\u0438<\/a> \u0441\u0442\u0430\u0442\u0443\u0441 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438. \u042d\u0442\u043e \u043e\u0431\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0441\u0442\u0430\u043b\u043e \u043f\u043e\u0432\u043e\u0434\u043e\u043c \u0434\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B1%D0%B8%D0%BB%D0%B8%D1%81%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%BE%D0%B1%D1%8B%D1%82%D0%B8%D1%8F_(1989)\" title=\"\u0422\u0431\u0438\u043b\u0438\u0441\u0441\u043a\u0438\u0435 \u0441\u043e\u0431\u044b\u0442\u0438\u044f (1989)\">\u0430\u043f\u0440\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043c\u0438\u0442\u0438\u043d\u0433\u0430 \u0432 \u0422\u0431\u0438\u043b\u0438\u0441\u0438 \u0432 \u0442\u043e\u043c \u0436\u0435 \u0433\u043e\u0434\u0443<\/a>, \u043f\u0440\u0438\u0432\u0435\u0434\u0448\u0435\u0433\u043e \u043a \u0434\u0440\u0430\u043c\u0430\u0442\u0438\u0447\u043d\u044b\u043c \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a><ul><li>\u041e\u0442 \u043f\u0435\u0440\u0432\u043e\u0439, \u0437\u0430\u043f\u0443\u0449\u0435\u043d\u043d\u043e\u0439 \u0434\u043b\u044f \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0\" title=\"\u041b\u0443\u043d\u0430\">\u041b\u0443\u043d\u044b<\/a>, \u044f\u043f\u043e\u043d\u0441\u043a\u043e\u0439 \u0410\u041c\u0421 \u00abMuses A\u00bb\/\u00abHiten\u00bb, \u0431\u044b\u043b \u043e\u0442\u0434\u0435\u043b\u0435\u043d \u043c\u0430\u043b\u044b\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442 \u00abHagoromo\u00bb \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043e\u0441\u0442\u0430\u043b\u0441\u044f \u043d\u0430 \u043e\u043a\u043e\u043b\u043e\u043b\u0443\u043d\u043d\u043e\u0439 \u043e\u0440\u0431\u0438\u0442\u0435.<\/li><li>\u041d\u0430 \u043f\u0435\u0440\u0432\u044b\u0445 \u043f\u043e\u0441\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933&#160;\u0433\u043e\u0434\u0430<\/a> \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u044b\u0445 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D0%B0%D1%8F_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a> 48 \u043f\u0440\u043e\u0446\u0435\u043d\u0442\u043e\u0432 \u0438\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043b\u0435\u0439 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u044e\u0442 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044e \u00ab\u0421\u043e\u044e\u0437 \u0437\u0430 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044e\u00bb.<\/li><li>\u043e\u0433\u0440\u0430\u0431\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%98%D0%B7%D0%B0%D0%B1%D0%B5%D0%BB%D0%BB%D1%8B_%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82_%D0%93%D0%B0%D1%80%D0%B4%D0%BD%D0%B5%D1%80\" tit