\/Windows_3.1\" class=\"mw-redirect\" title=\"Windows 3.1\">Windows 3.1<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%81%D0%BD%D0%B8%D1%8F_%D0%B8_%D0%93%D0%B5%D1%80%D1%86%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D0%BD%D0%B0\" title=\"\u0411\u043e\u0441\u043d\u0438\u044f \u0438 \u0413\u0435\u0440\u0446\u0435\u0433\u043e\u0432\u0438\u043d\u0430\">\u0411\u043e\u0441\u043d\u0438\u044f \u0438 \u0413\u0435\u0440\u0446\u0435\u0433\u043e\u0432\u0438\u043d\u0430<\/a>, \u0441 \u043e\u0434\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b, \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D1%80%D0%B2%D0%B0%D1%82%D0%B8%D1%8F\" title=\"\u0425\u043e\u0440\u0432\u0430\u0442\u0438\u044f\">\u0425\u043e\u0440\u0432\u0430\u0442\u0438\u044f<\/a>, \u0441 \u0434\u0440\u0443\u0433\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b, \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0442 \u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u0444\u0435\u0434\u0435\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u0431\u043e\u0441\u043d\u0438\u0439\u0441\u043a\u0438\u0445 \u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d \u0438 \u0445\u043e\u0440\u0432\u0430\u0442\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 162 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u0438\u0437 \u043d\u0438\u0445 \u043d\u0435 \u043c\u0435\u043d\u0435\u0435 150 \u043f\u043e\u0434\u0440\u043e\u0441\u0442\u043a\u043e\u0432, \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442 \u0432\u043e \u0432\u0440\u0435\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B6%D0%B0%D1%80_%D0%B2_%D0%BA%D0%BB%D1%83%D0%B1%D0%B5_%C2%AB%D0%9E%D0%B7%D0%BE%D0%BD_%D0%94%D0%B8%D1%81%D0%BA%D0%BE%C2%BB\" title=\"\u041f\u043e\u0436\u0430\u0440 \u0432 \u043a\u043b\u0443\u0431\u0435 \u00ab\u041e\u0437\u043e\u043d \u0414\u0438\u0441\u043a\u043e\u00bb\">\u043f\u043e\u0436\u0430\u0440\u0430 \u0432 \u043a\u043b\u0443\u0431\u0435 \u00ab\u041e\u0437\u043e\u043d \u0414\u0438\u0441\u043a\u043e\u00bb<\/a> \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B5%D1%81%D0%BE%D0%BD-%D0%A1%D0%B8%D1%82%D0%B8\" title=\"\u041a\u0435\u0441\u043e\u043d-\u0421\u0438\u0442\u0438\">\u041a\u0435\u0441\u043e\u043d-\u0421\u0438\u0442\u0438<\/a>. \u0412 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u0435 \u0434\u0438\u0441\u043a\u043e\u0442\u0435\u043a\u0438, \u0440\u0430\u0441\u0441\u0447\u0438\u0442\u0430\u043d\u043d\u043e\u0435 \u043b\u0438\u0448\u044c \u043d\u0430 35 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u043d\u0430\u0431\u0438\u043b\u043e\u0441\u044c \u043e\u043a\u043e\u043b\u043e 390 \u0447\u0435\u043b\u043e\u0432\u0435\u043a. \u041a\u043e\u0433\u0434\u0430 \u0432\u0441\u043f\u044b\u0445\u043d\u0443\u043b \u043f\u043e\u0436\u0430\u0440, \u043e\u043a\u0430\u0437\u0430\u043b\u043e\u0441\u044c, \u0447\u0442\u043e \u0430\u0432\u0430\u0440\u0438\u0439\u043d\u044b\u0439 \u0432\u044b\u0445\u043e\u0434 \u0431\u043b\u043e\u043a\u0438\u0440\u043e\u0432\u0430\u043d \u0441\u0442\u0440\u043e\u044f\u0449\u0438\u043c\u0441\u044f \u0440\u044f\u0434\u043e\u043c \u0437\u0434\u0430\u043d\u0438\u0435\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997_%D0%B3%D0%BE%D0%B4\" title=\"1997 \u0433\u043e\u0434\">1997<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%90%D0%BD-24_%D0%B2_%D0%A7%D0%B5%D1%80%D0%BA%D0%B5%D1%81%D1%81%D0%BA%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0410\u043d-24 \u0432 \u0427\u0435\u0440\u043a\u0435\u0441\u0441\u043